<script type="text/javascript">
	$(document).on("ready", function() {
		// untuk Menu Lain
		var $nav = $("#nav"),
			$wp1 = $(".wp1"),
			$wp2 = $(".wp2"),
			$wp3 = $(".wp3"),
			$wp4 = $(".wp4"),
			$navul = $nav.find("ul");

		$wp2.hide(); $wp3.hide(); $wp4.hide();

		$navul.find("li").eq(0).click(function () {
			$wp1.show(); $wp2.hide(); $wp3.hide(); $wp4.hide();
		});
		$navul.find("li").eq(1).click(function () {
			$wp1.hide(); $wp2.show(); $wp3.hide(); $wp4.hide();
		});
		$navul.find("li").eq(2).click(function () {
			$wp1.hide(); $wp2.hide(); $wp3.show(); $wp4.hide();
		});
		$navul.find("li").eq(3).click(function () {
			$wp1.hide(); $wp2.hide(); $wp3.hide(); $wp4.show();
		});


		// Untuk Bilangan Deret
		var $hitung = $("#hitung"),
			$bersih = $("#bersih"),
			$hasil,
			$hasilo = $("#hasil"),
			$hasilao = $("#hasila"),
			$counter = 0;

		$("#hasil").css("max-height", $(window).height());

		$bersih.click(function() {
			bersih($hasilo);
			bersih($hasilao);
			welcome($hasilao);
		})

		$hitung.click(function() {
			bersih($hasilo, hitung, 1);
		});

		welcome($hasilao);

		function bersih($selector, $afterclean, $second) {
			$selector.empty();
			if(typeof $afterclean == "function") {
				setTimeout($afterclean(), ($second * 1000));
			}
		}

		function hitung($after) {
			var $sn = parseInt($("#sn").val()),
				$sa = parseInt($("#sa").val()),
				$beda = parseInt($("#beda").val()),
				$suku = 0,
				$jumlah = 0;

			console.log($sa);

			if(($sn == "NaN") || ($sa == "NaN") || ($beda == "NaN")) {
				$hasilao.html("<p class='welcome alert'>Ooops tidak boleh ada yang kosong :)</p>");
			} else {
				for ($i = 1; $i <= $sn; $i++) {
					if($i == 1) {
						$suku = ($suku + $sa);
					} else if ($i != 1) {
						$suku = ($suku + $beda);
					}
					$jumlah = ($jumlah + $suku);

					$hasil = ("<p><u>Suku " + $i + " = " + $suku + " || " + "Jumlah Suku " + $i + " = " + $jumlah + "</u></p>");
					$hasilo.append($hasil);
				}

				$hasilao.html("<hr/> <p class='total'>Jadi hasil total dari Suku " + $sn + " adalah = " + "<u>" + $jumlah + "</u></p>");
			}

			if(typeof $after == "function") {
				$after();
			}
		}

		function welcome($selector) {
			$selector.html("<p class='welcome'>Welcome :)</p>");
		}
	});
</script>

</body>
</html>
